import Header from '../components/header';
import { useSelector } from 'react-redux';
import { RootState } from '../redux/store';
import { DebtData } from '../utils/type';
import { 
  MDBContainer,
  MDBRow,
  MDBCard,
  MDBCol,
  MDBBadge,
  MDBCardBody,
  MDBBtn,
  MDBIcon,
  MDBCardFooter
} from 'mdb-react-ui-kit';
import dashboard1 from '../images/dashboard1.svg';
import dashboard2 from '../images/dashboard2.svg';
import dashboard3 from '../images/dasboard3.svg';


function DashboardPage() {

  const { debtData } = useSelector((state: RootState) => state.debtList);

  const totalDebtAmount = debtData.reduce((total, debt) => total + debt.debtAmount, 0);
  const formatter = new Intl.NumberFormat('tr-TR', {
    style: 'currency',
    currency: 'TRY',
  });

  const averageInstallment = debtData.reduce((total, debt) => total +  debt.installment, 0) / debtData.length;
  const averageInterestRate = debtData.reduce((total, debt) => total + debt.interestRate, 0) / debtData.length;


    const today = new Date();
    const formattedToday = today.toISOString().split('T')[0];

    const upcomingPayments = debtData.filter(debt => {
      const paymentStartDate = new Date(debt.paymentStart).toISOString().split('T')[0];
      return paymentStartDate >= formattedToday; // Bugün veya sonrası için filtrele
    });

    const calculatePaymentAmount = (debt: DebtData): number => {
      // Örneğin taksit başına ödenecek miktar hesaplama
      return debt.debtAmount / debt.installment;
    };

    return (
      <div className="bg-light pages">
      <Header />
      <div className='px-2 py-4 pagesTitle'>DashboardPage</div>
      <MDBContainer fluid>
      <MDBRow className='justify-content-center'>
        <MDBCol md='10'>
          <section>
            <MDBRow>
              <MDBCol md='4'  className='mb-md-0 my-2'>
                <MDBCard>
                  <MDBCardBody>
                    <div className='d-flex align-items-center'>
                      <div className='flex-shrink-0'>
                        <div className='p-3 bg-primary rounded-4 shadow-2-strong'>
                        <img src={dashboard1} alt="" />
                        </div>
                      </div>
                      <div className='flex-grow-1 ms-4'>
                        <p className='text-muted mb-1'>Total debt</p>
                        <h2 className='mb-0'>
                        {formatter.format(totalDebtAmount)}
                        </h2>
                      </div>
                    </div>
                  </MDBCardBody>
                </MDBCard>
              </MDBCol>

              <MDBCol md='4' className='mb-md-0 my-2'>
                <MDBCard>
                  <MDBCardBody>
                    <div className='d-flex align-items-center'>
                      <div className='flex-shrink-0'>
                        <div className='p-3 bg-primary rounded-4 shadow-2-strong'>
                        <img src={dashboard2} alt="" />
                        </div>
                      </div>
                      <div className='flex-grow-1 ms-4'>
                        <p className='text-muted mb-1'>Average Installment</p>
                        <h2 className='mb-0'>
                         {averageInstallment}
                        </h2>
                      </div>
                    </div>
                  </MDBCardBody>
                </MDBCard>
              </MDBCol>

              <MDBCol md='4' className='mb-md-0 my-2'>
                <MDBCard>
                  <MDBCardBody>
                    <div className='d-flex align-items-center'>
                      <div className='flex-shrink-0'>
                        <div className='p-3 bg-primary rounded-4 shadow-2-strong'>
                          <img src={dashboard3} alt="" />
                        </div>
                      </div>
                      <div className='flex-grow-1 ms-4'>
                        <p className='text-muted mb-1'>Average Interest Rate</p>
                        <h2 className='mb-0'>
                         {averageInterestRate}
                        </h2>
                      </div>
                    </div>
                  </MDBCardBody>
                </MDBCard>
              </MDBCol>
            </MDBRow>
          </section>
        </MDBCol>
      </MDBRow>
    </MDBContainer>

      </div>
     );
   }

   export default DashboardPage;
